// src/App.jsx
import React, { useState } from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";

import AdminDashboard from "./pages/AdminDashboard";
import Dashboard from "./pages/Dashboard";
import Containers from "./pages/Containers";
import ContainerDetail from "./pages/ContainerDetail";
import History from "./pages/History";
import AllUsers from "./pages/AllUsers";
import NotFound from "./pages/NotFound";

import Login from "./auth/Login";
import Register from "./auth/Register";

// MANAGER IMPORTS
import ManagerDashboardLayout from "./pages/manager/ManagerDashboardLayout";
import ManagerHome from "./pages/manager/ManagerHome";
import ManagerRacks from "./pages/manager/ManagerRacks";
import ManagerHistory from "./pages/manager/ManagerHistory";

import { mockContainers, mockPermissionRequests } from "./data/Mockdata";

function App() {
  // ---------------------------------------------------------
  // GLOBAL SHARED STATE
  // ---------------------------------------------------------
  const [containers, setContainers] = useState(
    mockContainers.map((c) => ({
      ...c,
      slots: c.slots.map((s) => ({
        ...s,
        items: s.items || [],
      })),
    }))
  );

  const [permissionRequests, setPermissionRequests] = useState(
    mockPermissionRequests
  );

  const [approvedPermissions, setApprovedPermissions] = useState([]);

  // ---------------------------------------------------------
  // PERMISSION APPROVE / REJECT
  // ---------------------------------------------------------
  const handlePermissionApprove = (id) => {
    const approvedItem = permissionRequests.find((r) => r.id === id);

    setApprovedPermissions((prev) => [...prev, { ...approvedItem, status: "Approved" }]);

    setPermissionRequests((prev) => prev.filter((r) => r.id !== id));
  };

  const handlePermissionReject = (id) => {
    setPermissionRequests((prev) => prev.filter((r) => r.id !== id));
  };

  // ---------------------------------------------------------
  // CONTAINERS UPDATE
  // ---------------------------------------------------------
  const updateContainers = (updateFn) => {
    setContainers((prev) => updateFn(prev));
  };

  // ---------------------------------------------------------
  // ROUTES
  // ---------------------------------------------------------
  return (
    <BrowserRouter>
      <Routes>
        {/* Redirect root */}
        <Route path="/" element={<Navigate to="/login" replace />} />

        {/* Auth */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* =====================================
              ADMIN ROUTES
        ====================================== */}
        <Route path="/admin" element={<AdminDashboard />}>
          {/* Admin Home (Dashboard) */}
          <Route
            index
            element={
              <Dashboard
                containers={containers}
                permissionRequests={permissionRequests}
                onPermissionApprove={handlePermissionApprove}
                onPermissionReject={handlePermissionReject}
              />
            }
          />

          {/* Racks */}
          <Route
            path="racks"
            element={
              <Containers
                containers={containers}
                setContainers={setContainers}
                updateContainers={updateContainers}
              />
            }
          />

          {/* Container Detail */}
          <Route
            path="container/:id"
            element={<ContainerDetail containers={containers} />}
          />

          {/* Other */}
          <Route path="history" element={<History />} />
          <Route path="users" element={<AllUsers />} />
        </Route>

        {/* =====================================
              MANAGER ROUTES
        ====================================== */}
        <Route path="/manager" element={<ManagerDashboardLayout />}>
          {/* Manager Dashboard */}
          <Route
            index
            element={
              <ManagerHome
                containers={containers}
                approvedPermissions={approvedPermissions}
              />
            }
          />

          {/* Manager Racks */}
          <Route
            path="racks"
            element={
              <ManagerRacks
                containers={containers}
                setContainers={setContainers}
                updateContainers={updateContainers}
              />
            }
          />

          {/* Manager History */}
          <Route path="history" element={<ManagerHistory />} />
        </Route>

        {/* 404 */}
        <Route path="*" element={<NotFound />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
